const Negocios = ({ negocios }) => {
  return (
    <div>
      {negocios.map((negocio) => {
        return (
          <div className="negocios">
            <h4>Mercado Negociado: {negocio["Negociação"]}</h4>
            <h4>Compra ou venda: {negocio["C/V"]}</h4>
            <h4>Categoria do ativo: {negocio["Tipo de mercado"]}</h4>
            <h4>Nome do ativo: {negocio["Nome Pregão"]}</h4>
            <h4>Código do ativo: {negocio["Código"]}</h4>
            <h4>Quantidade: {negocio["Quantidade"]}</h4>
            <h4>Valor unitário: {negocio["Preço"]}</h4>
            <h4>Valor total: {negocio["Valor Operação"]}</h4>
            <h4>Coberto/Descoberto: {negocio["D/C"]}</h4>
          </div>
        );
      })}
    </div>
  );
};

export default Negocios;
